title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o14029.m12 -> o13986.m14 -> o14029.m0 -> o13986.m14
  o13986.m14 -> o14029.m0 -> o13986.m14
  o14029.m0 -> o13986.m14 -> o14029.m0

features:
  - inheritance
  - overriding
  - method
  - polymorphism

